import React from 'react';

function Employeetable(props) {
    console.log(props);
    return(
        <div>
        <tbody>
            <tr>
                <td data-th="Image">
                    <img src={props.image}></img>
                </td>
            </tr>

        </tbody>
        </div>
    )
}

export default Employeetable;
